import os
import cv2
import numpy as np
import base64
from sklearn.neighbors import KNeighborsClassifier
import joblib
from firebase import generate_custom_token

def predict_with_base64_images(base64_images):
    try:
        # Load the trained model
        knn = joblib.load('static/face_recognition_model.pkl')

        # Initialize lists to store results
        predicted_usernames = []

        for base64_image in base64_images:
            # Decode the base64 image string
            image_bytes = base64.b64decode(base64_image)
            image = cv2.imdecode(np.frombuffer(image_bytes, np.uint8), -1)

            if image is not None:
                # Resize the image
                resized_face = cv2.resize(image, (50, 50))

                # Flatten the resized face to 1D
                flattened_face = resized_face.ravel().reshape(1, -1)
                print("flattened_face", flattened_face.shape)
                # Perform prediction
                predicted_username = knn.predict(flattened_face)[0]

                # Store the result
                predicted_usernames.append(predicted_username)
            else:
                print("Error: Decoding image failed.")

        return predicted_usernames

    except Exception as e:
        print(f"Error during prediction: {str(e)}")


base64_images = [""""""]

# Example usage:
base64_images_to_predict = [base64_images[0]]
